import React from 'react';

const Navbar = () => {
  return (
    <nav className="w-full flex justify-center py-6 px-4 bg-gradient-to-r from-green-400 to-green-600 rounded-b-3xl shadow-lg">
      <div className="w-full max-w-7xl flex items-center justify-between">
        {/* Logo */}
        <div className="text-2xl font-extrabold text-green-900 bg-green-200 rounded-xl px-6 py-2 shadow-sm" style={{letterSpacing: '1px'}}>
          rankly360
        </div>
        {/* Menu */}
        <ul className="hidden md:flex space-x-10 text-lg font-semibold text-green-900">
          <li><a href="#" className="hover:text-green-700 transition">Home</a></li>
          <li><a href="#services" className="hover:text-green-700 transition">Services</a></li>
          <li><a href="#about" className="hover:text-green-700 transition">About</a></li>
          <li><a href="#mission" className="hover:text-green-700 transition">Our Mission</a></li>
        </ul>
        {/* CTA Button */}
        <a href="#consultation" className="ml-6 bg-green-200 text-green-900 font-bold px-6 py-3 rounded-full shadow-md hover:bg-green-300 transition text-base">
          Book a Free Consultation
        </a>
      </div>
    </nav>
  );
};

export default Navbar;
